import React, { Component } from "react";
import axios from "axios";

class Home extends Component {
  state = {
    videos: []
  };

  componentDidMount = () => {
    let data = {};

    // Send a GET request
    axios
      .get(this.apiEndPoint)
      .then(response => {
        data = response.data;

        this.setState({
          videos: data
        });
      })
      .catch(function(error) {
        // handle error
        console.log(error);
      });
  };
  apiEndPoint = "http://localhost:5000/api/videos";

  render() {
